import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import { Layout, Menu, Breadcrumb, theme } from 'antd';
import { 
  HomeOutlined, 
  SearchOutlined, 
  CompassOutlined,
  MenuFoldOutlined,
  MenuUnfoldOutlined
} from '@ant-design/icons';
import './App.css';
import FlightSearch from './pages/FlightSearch';
import NormalRouteBuilder from './pages/NormalRouteBuilder';

const { Header, Content, Footer, Sider } = Layout;

function App() {
  return (
    <Router>
      <AppLayout />
    </Router>
  );
}

function AppLayout() {
  const [collapsed, setCollapsed] = useState(false);
  const {
    token: { colorBgContainer, borderRadiusLG },
  } = theme.useToken();

  // Get current path to highlight active menu item
  const currentPath = window.location.pathname;
  const selectedKey = currentPath === "/" ? "1" :
                     currentPath === "/ac" ? "1" :
                     currentPath === "/normal" ? "2" : "1";

  return (
    <Layout style={{ minHeight: '100vh' }}>
      <Sider
        collapsible
        collapsed={collapsed}
        onCollapse={(value) => setCollapsed(value)}
        breakpoint="lg"
        collapsedWidth="0" 
        zeroWidthTriggerStyle={{ top: '10px' }}
      >
        <div className="demo-logo-vertical" />
        <div className="logo">
          {!collapsed && "ROUTE BUILDER"}
        </div>
        <Menu
          theme="dark"
          mode="inline"
          defaultSelectedKeys={[selectedKey]}
          items={[
            {
              key: '1',
              icon: <SearchOutlined />,
              label: <Link to="/ac">AC Route Builder</Link>,
            },
            {
              key: '2',
              icon: <CompassOutlined />,
              label: <Link to="/normal">Normal Route Builder</Link>,
            },
          ]}
        />
      </Sider>
      <Layout>
        <Header style={{ padding: 0, background: colorBgContainer }}>
          <div className="header-content">
            {collapsed ? (
              <MenuUnfoldOutlined 
                className="trigger" 
                onClick={() => setCollapsed(!collapsed)} 
              />
            ) : (
              <MenuFoldOutlined 
                className="trigger" 
                onClick={() => setCollapsed(!collapsed)} 
              />
            )}
            <Breadcrumb
              items={[
                {
                  title: <HomeOutlined />,
                },
                {
                  title: currentPath === "/" || currentPath === "/ac" ? "AC Route Builder" : "Normal Route Builder",
                },
              ]}
              style={{ margin: '0 16px' }}
            />
          </div>
        </Header>
        <Content
          style={{
            margin: '24px 16px',
            padding: 24,
            minHeight: 280,
            background: colorBgContainer,
            borderRadius: borderRadiusLG,
          }}
        >
          <Routes>
            <Route path="/ac" element={<FlightSearch />} />
            <Route path="/normal" element={<NormalRouteBuilder />} />
            <Route path="/" element={<Navigate to="/ac" replace />} />
          </Routes>
        </Content>
        <Footer style={{ textAlign: 'center' }}>
          Route Builder ©{new Date().getFullYear()} Created with Ant Design
        </Footer>
      </Layout>
    </Layout>
  );
}

export default App;
